import Vue from 'vue';
import App from './App.vue';
import * as VueGoogleMaps from 'vue2-google-maps';

Vue.use(VueGoogleMaps, {
  load: {
    key: 'AIzaSyD-9tSrke72PouQMnMX-a7eZSW0jkFMBWY',
    libraries: 'places', // Add any additional libraries if needed
  },
});

new Vue({
  render: (h) => h(App),
}).$mount('#app');
